IRON HORSE BATTERY STORAGE, LLC MARKET BASED RATE TARIFF
1. Availability: Seller makes electric energy, ancillary services and capacity available under this Rate Schedule to any purchaser for resale.
2. Applicability: This Rate Schedule is applicable to all sales of energy and capacity by Seller not otherwise subject to a particular rate schedule of Seller.
3. Rates: All sales shall be made at rates established by agreement between the purchaser and Seller.
4. Other Terms and Conditions: All other terms and conditions shall be established by agreement between the purchaser and Seller.
5. Ancillary Services: Seller may offer for sale those ancillary services in those markets specified and authorized by the Commission from time to time in orders extending such authority to all sellers authorized to sell electric energy and capacity at market-based rates, including:
PJM: Seller offers regulation and frequency response service, energy imbalance service and operating reserve service (which includes spinning, 10-minute reserves, and 30-minute reserves) for sale into the market administrated by PJM Interconnection, L.L.C. (PJM) and, where the PJM Open Access Transmission Tariff permits, the self-supply of these services, to any purchase for a bilateral sale that is used to satisfy the ancillary services requirements of the PJM Office of Interconnection;
New York: Seller offers regulation and frequency response service, and operating reserve service (which includes 10-minute non-synchronous, 30-minute operating reserves, 10-minute spinning reserves, and 10-minute non-spinning reserves) for sale to any purchaser in the market administrated by the New York Independent System Operator;
New England: Seller offers regulation and frequency response service (automatic generation control), operating reserve service (which includes 10-minute spinning reserves, 10-minute non-spinning reserves, and 30-minute operating reserves) for sale to any purchaser within the markets administered by ISO New England, Inc.;
California: Seller offers regulation service, spinning reserve service, and non-spinning reserve service to the California Independent System Operator (CAISO) and to others that are self-supplying ancillary services to the CAISO;
MISO: Seller offers regulation service and operating reserve service (which include 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Midcontinent Independent System Operator, Inc. (MISO) and to others that are self-supplying ancillary services to the MISO;
Southwest Power Pool: Seller offers regulation service and operating reserve service (which include 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Southwest Power Pool, Inc. (SPP) and to others that are self-supplying ancillary services to SPP. and
Third-Party Provider: Third-party ancillary services: Seller offers Regulation Service, Reactive Supply and Voltage Control Service, Energy and Generator Imbalance Service, Operating Reserve-Spinning, Operating Reserve-Supplemental, and Primary Frequency Response Service. Sales will not include the following: (1) sales to an RTO or an ISO, i.e., where that entity has no ability to self-supply ancillary services but instead depends on third parties; and (2) sales to a traditional, franchised public utility affiliated with the third-party supplier, or sales where the underlying transmission service is on the system of the public utility affiliated with the third-party supplier. Sales of Operating Reserve-Spinning and Operating Reserve-Supplemental will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except where the Commission has granted authorization. Sales of Regulation Service and Reactive Supply and Voltage Control Service will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except at rates not to exceed the buying public utility transmission providers OATT rate for the same service or where the Commission has granted authorization.
6. Compliance with Commission Regulations: Seller shall comply with the provisions of 18 C.F.R. Part 35, subpart H, as applicable, with any conditions the Commission imposes in its order concerning Sellers market-based rate authority, including orders in which the Commission authorizes Seller to engage in affiliate sales under this Rate Schedule or otherwise restricts or limits Sellers market-based rate authority. Failure to comply with the applicable provisions of 18 C.F.R. Part 35, Subpart H, and with any orders of the Commission concerning Sellers market-based rate authority, will constitute a violation of this Rate Schedule.
7. Limitations and Exemptions Regarding Market-Based Rate Authority: Seller has been granted the following waivers and blanket authorizations: (i) waiver of the accounting and reporting requirements contained in 18 C.F.R. Parts 41, 101, and 141, except Section 141.15, and with the exception that waiver of the provisions of Part 101 that apply to hydropower licenses is not granted with respect to licensed hydropower projects; (ii) waiver of 18 C.F.R. Part 35, Subparts B and C, except Sections 35.12(a), 35.13(b), 35.15, and 35.16; and (iii) blanket authorization for the issuance of securities or the assumption of liabilities pursuant to 18 C.F.R. Part 34. (Iron Horse Battery Storage, LLC, Docket No. ER17-987-000 (2017) (unpublished letter order)) 8. Seller Category: Seller is a Category 2 Seller in the Southwest region as defined in 18 C.F.R. § 35.36(a) and a Category 1 Seller in the Northeast, Southwest Power Pool, Southeast, Central and Northwest regions, as defined in 18 C.F.R. § 35.36(a).
9. Effective Date: This Rate Schedule is effective on the date specified by the Commission.
